import React from "react";
import "./image.css";

function Image(props) {
    return(
        <div>
        <div className="container-fluid">
            <div className="row">
            {/* <div className="col-md-3"> */}
            
                <span>
                    <img 
                        src={props.src} 
                        alt={props.alt} 
                        id={props.id} 
                        key={props.id}
                        onClick={() => props.clickme(props)}
                    />
                </span>
        {/* </div> */}
        </div>
        </div>
        </div>
     )
}

export default Image;
